	  317076,"12",20250,NULL,1949,
	  "0.25 USD",128.000,NULL,"This comic is made up of re-bound cover-less St. John publications.  It includes the contents of Adventures (St. John 1949 Series) #1. That section contains 32 pages and does not include the original comic's covers. The last story (The Black Lily) ends at an odd spot almost implying the original finished on the inside back cover.",
