	  317077,"13",20250,92,1950,
	  "0.25 USD",132.000,NULL,"This is 4 comics stripped of their original covers and rebound together under a new cover. Different combinations of comics were used so individual stories are not indexed here. The cover indexed here bound these 4 comics: Hollywood Confessions (St. John 1949 series) #2 (December 1949)Hollywood Pictorial Romances (St. John 1950 series) #3 (January 1950)Pictorial Romances (St. John 1950 series) #4 (January 1950)Mopsy (St. John 1948 series) (issue number unknown)Another known combination (per Greg Huneryager via the GCD Error Tracker) is:Hollywood Confessions (St. John 1949 series) #2 (December 1949)Hollywood Pictorial Romances (St. John 1950 series) #3 (January 1950)Pictorial Romances (St. John 1950 series) #4 (January 1950)Pictorial Confessions (St. John 1949 series) #3 (November 1949)A third combination is:Teen-Age Romances (St. John 1949 series) #8 (February 1950)Hollywood Confessions (St. John 1949 series) #2 (December 1949)Teen-Age Diary Secrets (St. John 1949 series) #8 (February 1950)Adventures in Romance (St. John 1949 series) #2 (February 1950)",
